import React, {Component} from "react";
import './Counter.css';

export default class Counter extends Component {
    render() {
        return (

            <div className="Counter">
                <button onClick={increment}>+1</button>
                <span className="count">0</span>
            </div>
        );
    }
}


function increment() {

}
